import "./Navbar.css";
import navbarLogo from "../.././assets/navbar-logo.png"

function Navbar() {
    return (
        <div className="navbar">
            <img src={navbarLogo}/>
            <div className="navbar-links">
                <a href="">Login</a>
                <a href="">Sign up</a>
            </div>
        </div>
    );
}

export default Navbar;
